import React,{ useState } from 'react';


const List=({todos})=>{

    return(
        <React.Fragment>
            <ul>
                {
                todos.map((ite,ind)=>(
                    <li style={{textDecoration:ite.status==="completed"?"underline":"none"}} key={ite.id} >
                        <a href={`/todos/todoitem?id=${ite.id}`}>
                          {ite.name}
                        </a>
                    </li>
                ))
            }
            </ul>

        </React.Fragment>
    )

}


export default List;
